Bio::
Родился в 1981 году в пгт Шамалды-Сай, г. Таш-Комур. По национальности кыргыз.

Высшее образование. В 2003 году окончил Джалал-Абадский коммерческий институт по специальности «экономист».

В 2003 году работал в многоотраслевом производственно-сельскохозяйственном кооперативе «Азиз КД»;

В 2007 году эксперт кредитного отдела Джалал-Абадского филиала «Инэксимбанка»;

В 2008 году начальник сберегательной кассы «БТА Банк» Шамалды-Сай № 42;

Депутат сельского совета в 2013 году;

Депутат сельсовета второй раз в 2016 году;

С 24 декабря 2013 года - глава айыл окмоту Достук, в 2016 году избран главой айыл окмоту на второй срок, в 2021 году третий раз избран главой айыл окмоту

Женатый. Имеет 3 сыновей и 1 дочь.
